import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Card() {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    axios.get('https://apod.nasa.gov/apod/image/2402/a14pan9335-43emj_900.jpg')
      .then(response => {
        setPosts(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <ul>
      {posts.map(post => (
        <li key={post.id}>{post.title}</li>
      ))}
    </ul>
  );
}

export default Card;
